comments.message:
for...in statements are better used on objects. A for...of is a better statement for arrays. You can grab the id in a similar way, but instead of an index, you get the item. We are moving towards using let and const to scope loop and other variables.

for (let item of vms) {
  APIUtils.getVirtualMedia(item['@odata.id']).then...
}

https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/for...of
